import React from "react";
import {createRoot} from "react-dom/client"
import "./style.css"


const root= createRoot(document.getElementById("root"))

function Nav(){
  return(<nav>
    <h1>Perfumy</h1>
    <ul>
        <li>
           Home | </li>
        <li>Products | </li>
        <li>About | </li>
        <li>Contact | </li>
    </ul>
    </nav>
    )
}




root.render(
  <Nav/>
)
